// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/AccessControl.sol";

contract FishRegistry is AccessControl {
    bytes32 public constant FISHER_ROLE = keccak256("FISHER_ROLE");
    bytes32 public constant PROCESSOR_ROLE = keccak256("PROCESSOR_ROLE");
    bytes32 public constant DISTRIBUTOR_ROLE = keccak256("DISTRIBUTOR_ROLE");
    bytes32 public constant RETAILER_ROLE = keccak256("RETAILER_ROLE");

    struct Lot {
        string specie;
        uint256 quantity;
        string captureCoordinates;
        uint256 timestampCapture;
        string boat;
        string state;
        bool exists;
    }

    uint256 public nextLotId = 1;

    mapping(uint256 => Lot) private lots;  // <-- FIX

    event LotCreated(uint256 indexed lotId, string specie, uint256 quantity, string coordinates, uint256 timestampCapture, string boat);
    event LotStateUpdated(uint256 indexed lotId, string oldState, string newState);

   

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(AccessControl)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    function createLot(
        string memory specie,
        uint256 quantity,
        string memory captureCoordinates,
        uint256 timestampCapture,
        string memory boat
    ) public onlyRole(FISHER_ROLE) returns (uint256) {
        uint256 lotId = nextLotId++;

        lots[lotId] = Lot({
            specie: specie,
            quantity: quantity,
            captureCoordinates: captureCoordinates,
            timestampCapture: timestampCapture,
            boat: boat,
            state: "Pescatore",
            exists: true
        });

        emit LotCreated(lotId, specie, quantity, captureCoordinates, timestampCapture, boat);
        return lotId;
    }

    function updateState(uint256 lotId, string memory newState) public {
        require(lots[lotId].exists, "Lot non esistente");
        require(
            hasRole(PROCESSOR_ROLE, msg.sender) ||
            hasRole(DISTRIBUTOR_ROLE, msg.sender) ||
            hasRole(RETAILER_ROLE, msg.sender) ||
            hasRole(DEFAULT_ADMIN_ROLE, msg.sender),
            "Non autorizzato"
        );

        string memory oldState = lots[lotId].state;
        lots[lotId].state = newState;

        emit LotStateUpdated(lotId, oldState, newState);
    }

    function getLot(uint256 lotId)
        public
        view
        returns (
            string memory specie,
            uint256 quantity,
            string memory captureCoordinates,
            uint256 timestampCapture,
            string memory boat,
            string memory state
        )
    {
        require(lots[lotId].exists, "Lot non esistente");
        Lot memory l = lots[lotId];
        return (
            l.specie,
            l.quantity,
            l.captureCoordinates,
            l.timestampCapture,
            l.boat,
            l.state
        );
    }
}
